function drawPlayer(playerId) {
    chosenPlayer = players[playerId];
    if (myDiagram) {
        myDiagram.div = null;
    }
    var $ = go.GraphObject.make;  // for conciseness in defining templates in this function

    myDiagram =
        $(go.Diagram, "myDiagramDiv");

    myDiagram.addDiagramListener("ObjectSingleClicked",
        function (e) {
            var part = e.subject.part;
            if (!(part instanceof go.Link)) {
                var newId = part.data.mundaneId;
                drawPlayer(newId);
            }
        });
    // myDiagram.addDiagramListener("ChangedSelection",
    // function(e) {
    //     var part = e.subject.part;
    //     if (!(part instanceof go.Link)) console.log("Clicked on " + part.data.key);
    //   });

    // define all of the gradient brushes
    var graygrad = $(go.Brush, "Linear", { 0: "#F5F5F5", 1: "#F1F1F1" });
    var bluegrad = $(go.Brush, "Linear", { 0: "#CDDAF0", 1: "#91ADDD" });
    var yellowgrad = $(go.Brush, "Linear", { 0: "#FEC901", 1: "#FEA200" });
    var lavgrad = $(go.Brush, "Linear", { 0: "#EF9EFA", 1: "#A570AD" });
    lavgrad = graygrad;

    // define the Node template for non-terminal nodes
    myDiagram.nodeTemplate =
        $(go.Node, "Auto",
            { isShadowed: true },
            // define the node's outer shape
            $(go.Shape, "RoundedRectangle",
                { fill: graygrad, stroke: "#D8D8D8" },
                new go.Binding("fill", "color")),
            // define the node's text
            $(go.TextBlock,
                { margin: 5, font: "bold 11px Helvetica, bold Arial, sans-serif" },
                new go.Binding("text", "persona"))
        );

    // define the Link template
    myDiagram.linkTemplate =
        $(go.Link,  // the whole link panel
            { selectable: false },
            $(go.Shape));  // the link shape

    // create the model for the double tree
    var rootItem = chosenPlayer;
    var treeArray = [];
    treeArray.push({ key: rootItem.mundaneId, mundaneId: rootItem.mundaneId, color: bluegrad, persona: rootItem.persona });
    addChildren(treeArray, rootItem);
    addParents(treeArray, rootItem);
    myDiagram.model = new go.TreeModel(treeArray);

    doubleTreeLayout(myDiagram);
}

function addChildren(treeArray, item) {
    if (item.children.length === 0) return;
    item.children.forEach(function (childItemId) {
        var aChild = players[childItemId];
        treeArray.push({ key: childItemId, mundaneId: childItemId, parent: item.mundaneId, persona: aChild.persona, dir: "right" });
        addChildren(treeArray, aChild);
    });
}

function addParents(treeArray, item) {
    if (item.parents.length === 0) return;
    item.parents.forEach(function (parentItemId) {
        var aParent = players[parentItemId];
        treeArray.push({ key: parentItemId, mundaneId: parentItemId, parent: item.mundaneId, persona: aParent.persona, dir: "left" });
        addParents(treeArray, aParent);
    });
}

function doubleTreeLayout(diagram) {
    // Within this function override the definition of '$' from jQuery:
    var $ = go.GraphObject.make;  // for conciseness in defining templates
    diagram.startTransaction("Double Tree Layout");

    // split the nodes and links into two Sets, depending on direction
    var leftParts = new go.Set(/*go.Part*/);
    var rightParts = new go.Set(/*go.Part*/);
    separatePartsByLayout(diagram, leftParts, rightParts);
    // but the ROOT node will be in both collections

    // create and perform two TreeLayouts, one in each direction,
    // without moving the ROOT node, on the different subsets of nodes and links
    var layout1 =
        $(go.TreeLayout,
            {
                angle: 180,
                arrangement: go.TreeLayout.ArrangementFixedRoots,
                setsPortSpot: false
            });

    var layout2 =
        $(go.TreeLayout,
            {
                angle: 0,
                arrangement: go.TreeLayout.ArrangementFixedRoots,
                setsPortSpot: false
            });

    layout1.doLayout(leftParts);
    layout2.doLayout(rightParts);

    diagram.commitTransaction("Double Tree Layout");
}

function separatePartsByLayout(diagram, leftParts, rightParts) {
    var root = diagram.findNodeForKey(chosenPlayer.mundaneId);
    if (root === null) return;
    // the ROOT node is shared by both subtrees!
    leftParts.add(root);
    rightParts.add(root);
    // look at all of the immediate children of the ROOT node
    root.findTreeChildrenNodes().each(function (child) {
        // in what direction is this child growing?
        var dir = child.data.dir;
        var coll = (dir === "left") ? leftParts : rightParts;
        // add the whole subtree starting with this child node
        coll.addAll(child.findTreeParts());
        // and also add the link from the ROOT node to this child node
        coll.add(child.findTreeParentLink());
    });
}


